import React, { Component } from "react";
import "./HeaderBar.css";

class NotLoggedInHeaderBar extends Component {
  constructor(props) {
    super(props);

    this.returnHome = this.returnHome.bind(this);
    this.dashboardClick = this.dashboardClick.bind(this);
  }

  returnHome() {
    window.location.replace("http://localhost:3000");
  }

  dashboardClick() {
    window.location.replace("http://localhost:3000/login");
  }

  render() {
    return (
      <div class="header">
        <div id="home-logo" onClick={this.returnHome}>
          <img
            class="logo"
            src={require("./images/logo_white.png")}
            alt="logo"
          />
          <h1 className="headerLabels">Rentmate</h1>
        </div>
        <div id="links">
          <h2 onClick={this.dashboardClick} id="login" className="headerLabels">
            My Dashboard
          </h2>
        </div>
      </div>
    );
  }
}

export default NotLoggedInHeaderBar;
